import React from "react";

import { Typography } from "@material-ui/core";

export const ContactDetail = ({ selected }) => {
  return (
    <>
      {selected ? (
        <Typography align="center" variant="h3">
          Contact Info
        </Typography>
      ) : (
        <Typography>Select a contact</Typography>
      )}
    </>
  );
};
